1230f64ef2d45d2e14aab04633961b7.jpg','/storage/system/20240719/d109147a6780283c10cf3c04733b833e.jpg,/storage/system/20240719/f878be61fa231a89e9b560473b10b2f2.jpg,/storage/system/20240719/e317e79487ed8757132e40fea4fcdc94.png',0,0,1,'<p>阿斯顿发送到发</p>','士大夫撒多发',1721383535,1722264098,NULL),(58,14,'市场交易规则','','',NULL,0,0,1,'<p><strong>尊敬的公益帮扶(HPC)会员</strong></p><p><br></p><p>温馨提示</p><p><br></p><p><strong>售、买HPC请仔细阅读以下规则</strong></p><p><br></p><p><strong>每位会员诚信值默认60分。</strong></p><p><br></p><p><strong>市场实行排单制度</strong></p><p><br></p><p><strong>出售个人资产HPC＞10，即可出售。</strong></p><p><br></p><p><strong>所有会员手续费统一30%，服务商统一10%。</strong></p><p><br></p><p>1：市场开放时间为：9：00至20：00，闭市期间，进行中的交易不受影响。</p><p><br></p><p>2：每个账号均可同时挂5单，完成交易1单后，可在发布1单，可始终保持挂5单，</p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\">卖方</strong><strong>：在出售过程中，一旦与买方匹配成功后，第一时间与买方联系，如与买方联系后，在2小时内完成付款，请立即确认。(如超出2小时未确认，系统自动扣10分诚信值)。</strong></p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\">注：如买方上传假图凭证，请立即订单投诉，并上传截图，说明原因，然后等待客服处理。</strong></p><p><br></p><p><strong style=\"color: rgb(230, 0, 0);\">买方</strong><strong>：接到卖方电话后或收到短信后，务必在2小时内付款，如超出小时未付款，系统自动扣除10诚信值。</strong></p>',NULL,1721700063,1722400632,NULL),(59,8,'帮助文章1','','',NULL,0,0,1,'<p>132143434还未∑他˜泰山石膏特呵呵人问题那个业务号泥土业务我让特为132143434还未∑他˜泰山石膏特呵呵人问题那个业务号泥土业务我让特为</p>','132143434',1721700666,1721700710,NULL),(60,11,'代理须知','','',NULL,0,0,1,'<p>1. 申请人须具备完全民事行为能力，热爱公益事业，有奉献精神。</p><p>2. 申请人需认同并遵守本HPC组织的规定和章程。</p><p>3. 申请人需提供真实有效的个人信息和联系方式。</p><p><br></p>',NULL,1721702872,1721830363,NULL),(61,12,'代理条件','','',NULL,0,0,1,'<p>1：.持有公益帮扶HPC群，(QQ群或微信群)。</p><p>2： 持有线下工作室或线上团队社区领导人。</p><p>3：.申请服务商缴纳1000HPC作为保证金。</p>',NULL,1721702926,1721830773,NULL),(62,13,'代理权益','','',NULL,0,0,1,'<p>1.服务商交易费0%</p><p>2.服务商组建服务群,严格保守群信息</p><p>3.可转让</p><p>4.更多权益敬请期待,最终解释权归官方所有</p>',NULL,1721702971,1721703120,NULL),(63,15,'提USDT规则','','',NULL,0,0,1,'<p>温馨提示</p><p>1：平台提USDT比例为1USDT<strong>:</strong>7.3RNB,提现手续费30%。</p><p>2：个人资产&gt;100USDT，均可提现到钱包或交易所。</p><p>3：填写钱包地址时，一定认真核对后，再提交，一旦提交后，系统自动扣除HPC。提USDT过程中，无法退款，若HPC提现失败，系统会自动退款，24小时内到账。</p><p>4：如充值成功，您的订单将会在72小时内到账，请注意查收您的钱包。</p>',NULL,1721723178,1722267183,NULL),(64,16,'生活缴费详细介绍规则','','',NULL,0,0,1,'<h3><strong>温馨提示</strong></h3><p>1：携号转网号码，副卡号码不可充值。</p><p><br></p><p>2：订单未成功之前，请勿通过其他方式充值。</p><p><br></p><p>3：支付成功后并HPC劵扣除成功后，系统会立即进入充值程序，所以无法退款，若HPC劵扣除失败，系统会自动退款，退款24小时到账。</p><p><br></p><p>4：为防止刷单损失，工作人员将为您手动充值。</p><p><br></p><p>5：您的订单将在72小时内到账。请注意查收。</p>',NULL,1721723221,1722266436,NULL),(65,3,'热烈欢迎全球HPC志愿者加入公益帮扶大家庭','','/storage/system/20240729/f5e528dd4f654af1159738063f0be9da.png','/storage/system/20240723/793445169309e9b4593035337ebcd238.png',0,0,1,'<p>尊敬的公益帮扶(HPC)会员</p><p>售、买HPC请仔细阅读以下规则</p><p>每位会员诚信值默认60分</p><p>出售个人HPC＞10，即可出售，</p><p>所有会员手续费统一30%，服务商统一10%。</p><p>卖方：在出售过程中，一旦与买方匹配成功后，第一时间与买方联系，如与买方联系后，在2小时内完成付款，请立即确认。(如超出2小时未确认，系统自动扣10分诚信值)。</p><p>注：如买方上传假图凭证，请立即投诉，等待客服处理。</p><p>买方：接到卖方电话后或收到短信后，务必在小时内付款，如超出小时未付款，诚信值扣10分。</p>',NULL,1721746374,1722230996,NULL),(66,4,'新会员注册、实名、添加支付操作指南','','/storage/system/20240729/19b33206b2e90afe28a596571831f8df.png','/storage/system/20240725/91216b52864f40181874eabcec18092c.jpg',0,0,1,'<p><img src=\"/storage/system/20240729/4cdc46ba033be5bf8ea80260e7a21806.png\"></p>','4324324',1721873456,1722230913,NULL);
