--
-- Table structure for table `qu_member_accounts`
--

DROP TABLE IF EXISTS `qu_member_accounts`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `qu_member_accounts` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '系统编号',
  `floor` tinyint(4) NOT NULL DEFAULT '0' COMMENT '会员层级',
  `uuid` char(12) NOT NULL DEFAULT '0' COMMENT '用户邀请ID',
  `agent_line` char(255) NOT NULL DEFAULT '0|' COMMENT '用户邀请人路径',
  `inviter_line` char(255) NOT NULL DEFAULT '0|' COMMENT '用户邀请路径',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '账户状态，1：正常，-1：冻结',
  `level` tinyint(2) NOT NULL DEFAULT '0' COMMENT '会员等级',
  `authen` tinyint(1) NOT NULL DEFAULT '-1' COMMENT '实名状态，{1：正常，0：未实名，2：认证中}',
  `inviter` varchar(12) NOT NULL DEFAULT '' COMMENT '邀请码',
  `sincerity` int(11) unsigned NOT NULL DEFAULT '60' COMMENT '诚信值',
  `password` varchar(128) NOT NULL DEFAULT '' COMMENT '登录密码',
  `api_id` varchar(64) NOT NULL DEFAULT '' COMMENT 'APIID',
  `api_key` varchar(64) NOT NULL DEFAULT '' COMMENT 'APIKEY',
  `safeword` varchar(128) NOT NULL DEFAULT '' COMMENT '安全密码',
  `area_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '区域代理类别',
  `area_code` char(255) NOT NULL DEFAULT '' COMMENT '用户邀请人路径',
  `create_time` int(11) DEFAULT NULL COMMENT '创建时间',
  `update_time` int(11) DEFAULT NULL COMMENT '更新时间',
  `delete_time` int(11) DEFAULT NULL COMMENT '删除时间',
  `remark` text COMMENT '冻结原因',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `index` (`floor`,`uuid`,`agent_line`(191),`inviter_line`(191),`status`,`level`,`authen`,`inviter`,`create_time`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=200 DEFAULT CHARSET=utf8mb4 COMMENT='会员账户';
/*!40101 SET character_set_client = @saved_cs_client */;

